def xorFibonacciSum(a: int, b: int, N: int) -> int:
	def xorFibonacci(a, b, n):
		if n == 0:
			return a
		if n == 1:
			return b
		return xorFibonacci(a, b, n - 1) ^ xorFibonacci(a, b, n - 2)

	result = 0
	for i in range(N):
		result += xorFibonacci(a, b, i)
	return result

