        return 1
    prev_row = [1]
    for i in range(1, k + 1):
        curr_row = [1]
        for j in range(1, i):
            curr_row.append(prev_row[j - 1] + prev_row[j])
        curr_row.append(1)
        prev_row = curr_row
    return sum(curr_row)

