import math

def magicNumber(arr: List[int]) -> float:
    def countDivisors(num: int) -> int:
        count = 0
        for i in range(1, int(math.sqrt(num)) + 1):
            if num % i == 0:
                if num / i == i:
                    count += 1
                else:
                    count += 2
        return count

    magic_sum = 0
    for num in arr:
        divisors = countDivisors(num)
        magic_sum += num * math.sqrt(divisors)

    return magic_sum

