def rho_factor(n: int) -> int:
	if n&1==0:
		return 2

	x = randint(2, n) #randomization
	y = x
	c = randint(1, n-1)
	d = 1
	while d==1:
		x = (x * x +c) % n
		y = (y * y +c) % n
		y = (y * y +c) % n
		d = gcd(abs(x-y), n)

	return d

