def combinationSum(nums: List[int], target: int) -> List[List[int]]:
    result = []

    def backtrack(remain, path, start):
        if remain < 0:
            return
        if remain == 0:
            result.append(path)
            return
        for i in range(start, len(nums)):
            backtrack(remain - nums[i], path + [nums[i]], i)

    nums.sort()
    backtrack(target, [], 0)
    return result

