def minScore(N: int) -> int:
    primes = [2]
    for num in range(3, N + 1):
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                break
        else:
            primes.append(num)

    dp = [0] * (N + 1)
    for i in range(2, N + 1):
        dp[i] = float('inf')
        for prime in primes:
            if prime > i:
                break
            dp[i] = min(dp[i], 1 + dp[i - prime])
        power = 1
        while 2 ** power <= i:
            dp[i] = min(dp[i], 1 + dp[i - 2 ** power])
            power += 1
    return dp[N]

