def greatestCommonDivisorOfProductOfTriplets(head):
    current = head
    product_list = []
    while current != None:
        first = current.next
        last = current
        while last.next != None:
            last = last.next

        while first != last and last.next != first:
            product_list.append(current.data * first.data * last.data)
            first = first.next
