	matrix = [[0 for i in range(N)] for j in range(N)]
	value = 1
	for i in range(N // 2):
		for j in range(i, N - i - 1):
			matrix[i][j] = value
			value += 1
		for j in range(i, N - i - 1):
			matrix[j][N - i - 1] = value
			value += 1
		for j in range(N - i - 1, i, -1):
			matrix[N - i - 1][j] = value
			value += 1
		for j in range(N - i - 1, i, -1):
