    for a in range(1, x+1):
        for b in range(1, x+1):
            for c in range(1, x+1):
                for d in range(1, x+1):
                    if factorial(a) - factorial(b) % (factorial(c)) == 0 and factorial(d) == compute_hcf(a, b, c, d):
