def combinationSum(digits, target):
    result = []
    digits.sort()

    def backtrack(remain, path, start):
        if remain < 0:
            return
        if remain == 0:
            result.append(list(path))
            return
        for i in range(start, len(digits)):
            path.append(digits[i])
            backtrack(remain - digits[i], path, i)
            path.pop()

    backtrack(target, [], 0)
    return result

