def generateFibonacciPatterns(n: int) -> List[List[int]]:
    def isFibonacci(arr):
        if len(arr) < 3:
            return False
        for i in range(2, len(arr)):
            if arr[i-2] + arr[i-1] != arr[i]:
                return False
        return True

    def backtrack(arr, result):
        if len(arr) == n:
            if isFibonacci(arr):
                result.append(arr[:])
            return
        for num in [0, 1]:
            arr.append(num)
            backtrack(arr, result)
            arr.pop()

    result = []
    backtrack([], result)
    return result

