def phi(n) -> int:
	ans = n
	p = 2
	while(p * p<= n):
		if (n % p == 0):
			while (n % p== 0):
				n = n // p
			ans = ans // p
			ans = ans * (p - 1)
		p += 1

	if (n> 1):
		ans = ans // n
		ans = ans * (n - 1)

	return ans


