def earliestMaxDivisibleInRange(A: int, B: int) -> int:
    def eulerTotient(n):
        result = n
        p = 2
        while p*p <= n:
            if n % p == 0:
                while n % p == 0:
                    n //= p
                result -= result // p
            p += 1
        if n > 1:
            result -= result // n
        return result

    max_divisible_count = 0
    result = -1
    for i in range(A, B+1):
        count = eulerTotient(i)
        if count > max_divisible_count:
            max_divisible_count = count
            result = i
    return result

