    def get_multiples(x, limit):
        multiples = set()
        multiple = x
        while multiple <= limit:
            multiples.add(multiple)
            multiple += x
        return multiples

    unique_multiples = set()
    num_gcd = nums[0]
    num_lcm = nums[0]
    for num in nums:
        num_gcd = gcd(num, num_gcd)
        num_lcm = lcm(num, num_lcm)
    for num in nums:
        multiples_gcd = get_multiples(num_gcd, 1000)
