def nearestPowerOfTwo(num: int) -> List[int]:
    freq = [0]*10 # to store frequencies of each digit
    while (num != 0):
        freq[num%10] += 1
        num = num//10

    result = []
    for i in range(10):
        if freq[i] == 0:
            result.append(0)
        else:
            val = 1
            while val < freq[i]: # finding nearest power of 2
                val = val*2
            diff1 = val - freq[i]
            diff2 = diff1
            if (val != 1 and diff1 > freq[i] - val//2):
                diff2 = freq[i] - val//2
            if diff1 > diff2:
                val = val//2
            result.append(val)
    return result

def generateSpiral(n: int) -> str:
    if n == 1:
        return "1"

    spiral = [[0]*n for _ in range(n)]

    num = 1
    top, bottom, left, right = 0, n-1, 0, n-1

    while top <= bottom and left <= right:
        for i in range(left, right+1):
            spiral[top][i] = num
            num += 1
        top += 1

        for i in range(top, bottom+1):
            spiral[i][right] = num
            num += 1
        right -= 1

        for i in range(right, left-1, -1):
            spiral[bottom][i] = num
            num += 1
        bottom -= 1

        for i in range(bottom, top-1, -1):
            spiral[i][left] = num
            num += 1
        left += 1

    result = ""
    for row in spiral:
        for val in row:
            result += str(val)
    return result

