    num_str = str(n)
    prefix_sums = [0] * (len(num_str) + 1)
    for i in range(1, len(num_str) + 1):
        prefix_sums[i] = prefix_sums[i - 1] + int(num_str[i - 1])
    dp = [[0] * (k + 1) for _ in range(len(num_str) + 1)]
    for i in range(1, len(num_str) + 1):
        for j in range(1, k + 1):
            dp[i][j] = float('inf')
            for x in range(i):
