def evaluateArithmeticExpression(expression: str) -> int:
    stack = []
    for char in expression:
        if char.isdigit():
            stack.append(int(char))
        elif char in ['+', '*']:
            num2 = stack.pop()
            num1 = stack.pop()
            if char == '+':
                stack.append(num1 + num2)
            elif char == '*':
                stack.append(num1 * num2)
    return stack.pop()

