def sqrt(n: int) -> int:
    if n < 2:
        return n

    low, high = 2, n // 2
    while low <= high:
        mid = (low + high) // 2
        squared = mid * mid
        if squared == n:
            return mid
        elif squared < n:
            low = mid + 1
        else:
            high = mid - 1
    return high

