def countWaysToRepresentAsSum(N: int, series: List[int]) -> int:
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def commonDivisors(a, b):
        result = 0
        gc = gcd(a, b)
        for i in range(1, int(gc**0.5) + 1):
            if gc % i == 0:
                if gc / i == i:
                    result += 1
                else:
                    result += 2
        return result

    ways = [0] * (N + 1)
    ways[0] = 1
    for num in series:
        for i in range(num, N + 1):
            ways[i] += ways[i - num] * commonDivisors(num, i)
    return ways[N]

