def sumPerfectPowers(s: str, k: int) -> int:
    stack = []
    cur = ""
    power_sum = 0
    for c in s:
        if c.isdigit() and stack == []:
            cur += c
        elif c == "(":
            if cur != "":
                stack.append(int(cur))
                cur = ""
            else:
                stack.append(c)
        elif c.isdigit():
            cur += c
        elif c == ")":
            last = stack.pop()
            if len(stack) == k-1:
                if perfect_power(last):
                    power_sum += last
        else:
            if cur != "":
                stack.append(int(cur))
                cur = ""
    return power_sum

