def isHyperperfect(n: int) -> bool:
    div_sum = 0
    i = 1
    while i <= math.sqrt(n):
        if n % i == 0:
            if n / i == i:
                div_sum += i
            else:
                div_sum += (i + n // i)
        i += 1
    div_sum -= n  # Exclude the number itself from the sum of divisors
    return div_sum == 2 * n

