        if n == 0:
            return (0, 1)
        else:
            a, b = fibHelper(n // 2)
            c = a * ((b << 1) - a)
            d = a * a + b * b
            if n % 2 == 0:
                return (c, d)
            else:
                return (d, c + d)
    a, _ = fibHelper(n)
    return a

