    epsilon = 0.001
    while abs(b - a) > epsilon:
        mid = (a + b) / 2
        f_mid = pascal_function(mid)
        f_mid_minus_1 = pascal_function(mid - 1)
        if f_mid > f_mid_minus_1:
            a = mid
        else:
            b = mid
    return (a + b) / 2

