def findNthTermDivisibleByABC(a: int, b: int, c: int, n: int) -> int:

	def gcd(a, b):
		while b > 0:
			a, b = b, a % b
		return a

	def lcm(a, b):
		return (a * b) // gcd(a, b)

	lcmAB = lcm(a, b)
	lcmBC = lcm(b, c)
	lcmAC = lcm(a, c)
	lcmABC = lcm(a, lcmBC, c)

	ans = (n // a) + (n // b) + (n // c) - (n // lcmAB) - (n // lcmBC) - (n // lcmAC) + (n // lcmABC)
	return ans * min(a, b, c)

