def findCoprimeCombinations(N: int) -> List[List[int]]:
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a

    def backtrack(remain, comb, start):
        if remain == 0 and gcd(*comb) == 1:
            output.append(list(comb))
            return
        elif remain < 0:
            return
        for i in range(start, N+1):
            comb.append(i)
            backtrack(remain - i, comb, i)
            comb.pop()

    output = []
    backtrack(N, [], 1)
    return output

