def leastPerfectSquare(N: int) -> int:
    if N < 0:
        return -1
    if N == 0 or N == 1:
        return N

    start = 0
    end = N
    while start <= end:
        mid = (start + end) // 2
        if mid*mid == N:
            return mid*mid
        elif mid*mid < N:
            start = mid + 1
        else:
            end = mid - 1
    return (start*start)

