    # Count the number of 2s that divide n
    while n % 2 == 0:
        factors.append(2)
        n = n // 2
    # n must be odd at this point, so a skip of 2 is used
    for i in range(3, int(n**0.5)+1, 2):
        # While i divides n, append i and divide n
