def dixonFactorizationMethod(n):
    def distPrimes(n):
        primeList = []
        for i in range(2, n+1):
            if n%i==0:
                count=0
                while(n%i==0):
                    n//=i
                    count+=1
                primeList.append((i,count))
        return primeList

    def finiteAutomata(text, pattern):
