        pass

    def factorBase(n):
        num = 2
        factors = []
        while num <= math.sqrt(n):
            if n % num == 0:
                factors.append(num)
                n = n // num
            else:
                num += 1
        factors.append(n)
        return factors

    def isSmooth(x, factors):
        for factor in factors:
            if x%factor != 0:
                return False
        return True

    def dixon(n):
        k = int(math.sqrt(n))
        X = k + 1
        factors = factorBase(X**2 % n)
        Y = 1
        while True:
            Y = Y + 1
            t = (Y**2 % n)
            Z = t
            t = (t - 1) // 2
            if t == 0:
                t = -1
            for factor in factors:
                t = (t * (Z - factor)) % n
            if t == 0:
                Z = (Y**2 % n)
                Z = (Z - 1) // 2
                if Z == 0:
                    Z = -1
                factorsT = distPrimes(Z)
                if len(factorsT) == len(factors):
                    if isSmooth(Z, factors):
                        a = X * Y % n
                        b = a * a % n
                        factorsA = distPrimes(b)
                        if len(factorsA) == len(factors) and isSmooth(b, factors):
                            p = math.gcd(a - int(math.sqrt(b)), n)
                            if 1 < p < n:
                                q = n // p
                                return p, q

    return dixon(n)

