def flipBitsCountSetBits(A: int, B: int) -> int:
    def countSetBits(n: int) -> int:
        count = 0
        while n:
            count += n & 1
            n >>= 1
        return count

    set_bits_sum = countSetBits(A) + countSetBits(B)
    flipped_sum = 0
    while set_bits_sum:
