		cnt = 0
		while n % 2 == 0:
			cnt += 1
			n = n // 2
		for i in range(3,int(n**0.5)+1,2):
			while n % i== 0:
				cnt += 1
				n = n // i
		if n > 2:
			cnt += 1
		return cnt
	def findSets(N, K):
