	i = len(expression) - 1
	while i >= 0:
		if expression[i].isdigit():
			num = 0
			multiplier = 1
			while i >= 0 and expression[i].isdigit():
				num += int(expression[i]) * multiplier
				multiplier *= 10
				i -= 1
			stack.append(num)
		elif expression[i] == '+':
			stack.append(stack.pop() + stack.pop())
		elif expression[i] == '*':
			stack.append(stack.pop() * stack.pop())
		elif expression[i] == '^':
			stack.append(stack.pop() ** stack.pop())
		i -= 1
	return stack.pop()

