    def mat_mult(A, B):
        a, b, c = A
        d, e, f = B
        return (a*d + b*e, a*e + b*f, b*e + c*f)

    def power(M, n):
        if n == 1:
            return M
        if n % 2 == 0:
            half = power(M, n // 2)
            return mat_mult(half, half)
        else:
            half = power(M, (n-1) // 2)
            return mat_mult(mat_mult(half, half), M)

    if n == 0:
        return 0
    A = (1, 1, 0)
