def sumAndProductFibNodes(head):

	first = 0
	second = 1
	sumFib = 0
	productFib = 1
	while (first <= head.data):
		if (first == head.data):
			sumFib += head.data
			productFib *= head.data
			break

		nextFib = first + second
		first = second
		second = nextFib

	while (head != None and head.data <= nextFib):
		if (head.data == nextFib):
			sumFib += head.data
			productFib *= head.data
		head = head.next
	return (sumFib, productFib)

