def splitSum(N: int, K: int) -> List[int]:
    res = []
    if N < 1 or N < K ** 2:
        return res

    for i in range(K-1, -1, -1):
        if N - i >= (K - 1) * (K - 2) // 2:
            res.append(N - i)
