        return []

    def grayCodeRecursion(n):
        if n == 1:
            return ['0', '1']
        else:
            prev_gray_code = grayCodeRecursion(n-1)
            new_gray_code = []
            for code in prev_gray_code:
                new_gray_code.append('0' + code)
            for code in reversed(prev_gray_code):
