def sumPowerfulPascalRow(N: int) -> int:
    row_sum = 0
    seen = set()
    q = deque([(1, 1)])
    for _ in range(N + 1):
        for _ in range(len(q)):
            val, row = q.popleft()
            if val not in seen and isPowerful(val):
                row_sum += val
                seen.add(val)
            if row < N:
