def primeFactorization(n: int) -> dict:
    factors = defaultdict(int)
    divisor = 2
    while n > 1:
        while n % divisor == 0:
            factors[divisor] += 1
            n = n // divisor
        divisor += 1
        if divisor * divisor > n:
            if n > 1: factors[n] += 1
            break
    return dict(factors)

