	dp[0] = 1
	currA = currB = currC = 0
	for i in range(1, k + 1):
		dp[i] = min(dp[currA] * a, dp[currB] * b, dp[currC] * c)
		if dp[i] == dp[currA] * a:
			currA += 1
		if dp[i] == dp[currB] * b:
			currB += 1
		if dp[i] == dp[currC] * c:
