def getModeOfDivisorsSumMultiplication(N: int, value: List[int], edges: List[Tuple[int,int]], modulus: int) -> int:
    def sum_of_divisors(n):
        result = 0
        for i in range(1, int(n**0.5) + 1):
            if n % i == 0:
                result += i
                if i != n // i:
                    result += n // i
        return result

    def mode(arr, mod):
        frequency = {}
        for num in arr:
            if num % mod in frequency:
                frequency[num % mod] += 1
            else:
                frequency[num % mod] = 1
        max_freq = 0
        mode_value = -1
        for key, value in frequency.items():
            if value > max_freq:
                max_freq = value
                mode_value = key
        return mode_value

    divisors_sum = []
    for i in range(N):
        divisors_sum.append(sum_of_divisors(value[i]))

    product = 1
    for i in range(N):
        product = (product * divisors_sum[i]) % modulus

    return mode(divisors_sum, modulus)

