def findPossibleNumbers(A: int, B: int, N: int, M: int) -> List[int]:
    numbers = set()
    stack = [N]
    for _ in range(M):
        new_stack = []
        while stack:
            num = stack.pop()
            new_stack.append(num + A)
            new_stack.append(num + B)
        stack.extend(new_stack)
    for num in stack:
        numbers.add(num)
    return list(numbers)

