        phi = num
        p = 2
        while p * p <= num:
            if num % p == 0:
                while num % p == 0:
                    num = num // p
                phi = phi - phi // p
            p = p + 1
        if num > 1:
            phi = phi - phi // num
        return phi

    sum_multiples = sum(i for i in range(1, range_limit) if i % m == 0 or i % n == 0)
