def sqrt(x: int) -> int:
	if (x == 0 or x == 1):
		return x
	start = 1
	end = x
	ans = 0
	while (start <= end):
		mid = (start + end) // 2
		if (mid * mid == x):
			return mid
		if (mid * mid < x):
			start = mid + 1
			ans = mid
		else:
			end = mid - 1
	return ans

