def eulerTotientFunction(n):
    result = 1
    p = 2
    while p * p <= n:
        if n % p == 0:
            count = 0
            while n % p == 0:
                n = n // p
                count += 1
            result *= (p - 1) * pow(p, count - 1)
        p += 1

    if n > 1:
        result *= (n - 1)
    return result

