def calculate_totient(n: int) -> int:
    result = n
    p = 2
    while p * p <= n:
        if n % p == 0:
            while n % p == 0:
                n = n // p
            result = result - (result // p)
        p = p + 1
    if n > 1:
        result = result - (result // n)
    return result

def store_totient_values(arr: list) -> Dict[int, int]:
