def convertToBase(n: int, base: int) -> int:
	if (n == 0):
		return 0
	digits = []
	while(n > 0):
		digits.append(n % base)
		n //= base
	digits.reverse()
	result = 0
	for digit in digits:
		result = result * 10 + digit
	return result

