def probabilityOfHeads(binaryStr: str, p: float) -> float:
    # Count the number of leading zeros
    leadingZeros = 0
    for bit in binaryStr:
        if bit == '0':
            leadingZeros += 1
        else:
            break

    # Compute the probability of getting a head
    probability = 1 - (p ** (len(binaryStr) - leadingZeros))

    return probability

