def divide(dividend: int, divisor: int) -> int:
    if (dividend == -2147483648 and divisor == -1):
        return 2147483647
    if dividend == 0:
        return 0

    a = abs(dividend)
    b = abs(divisor)

    result = 0

    while a >= b:
        x = 0
        while a >= (b << x):
            x += 1
        a -= (b << (x - 1))
        result += (1 << (x - 1))

    if (dividend < 0 and divisor > 0) or (dividend > 0 and divisor < 0):
        return -result
    else:
        return result

