class Solution:
    def sumOfPairwiseExclusiveLastN(self, head: ListNode, n: int) -> int:
        temp = head
        count = 0
        while temp:
            count += 1
            temp = temp.next
        if count < n:
            return -1
        temp = head
        sum = 0
        for i in range(count - n):
            temp = temp.next
        while temp:
            sum += temp.val
            if temp.next:
                temp = temp.next.next
            else:
                break
        return sum

