def least_common_multiple_counts(lst, n):
    counts = list(map(lambda x: x.count(n), lst))
    def gcd(x, y):
        while y != 0:
            x, y = y, x % y
        return x
    def lcm(x, y):
        return x * y // gcd(x, y)
    return reduce(lcm, counts)

