def divisorsGeometricMean(N: int) -> int :
	divisors = []
	i = 1
	while i * i <= N : 
		if N % i == 0 : 
			if N // i == i : 
				divisors.append(i)
			else : 
				divisors.append(i)
				divisors.append(N // i)
		i = i + 1

	divisors.sort()
	n = len(divisors)
	geometricMean = 1.0
	for i in range(0, n) :
		geometricMean *= divisors[i] 
	geometricMean = pow(geometricMean, (1.0 / n))

	return int(geometricMean)

