def totalEnergyOfTriplets(energyLevels: List[int]) -> int:
    mod = 10**9 + 7
    energyLevels.sort()
    total_energy = 0
    n = len(energyLevels)
    for i in range(n - 2):
        for j in range(i + 1, n - 1):
            for k in range(j + 1, n):
                total_energy += (abs(energyLevels[i]) * abs(energyLevels[j]) * abs(energyLevels[k]))
    return total_energy % mod

