def flipConsecutiveSetBits(n: int) -> int:
    if n == 0:
        return 1
    i = 0
    for i in range(64):
        if (n >> i) & 1 == 1:
            if i == 0:
                continue
            if (n >> i-1) & 1 != 1:
                break
        else:
            n ^= (1 << i)
    return n

