def findCousinPrimes(n: int) -> list:
    cousin_pairs = []
    for i in range(1, n+1):
        if isPrime(i) and isPrime(i+4):
            cousin_pairs.append((i, i+4))
        elif isPrime(i) and isPrime(i-4):
            cousin_pairs.append((i-4, i))
    return cousin_pairs

